            <th>URL</th>
          </tr>
          {items.map(item => (
            <tr key={item.productId}>
              <td>
                {item.productId}
              </td>
              <td className="price">
                {item.amount}
              </td>
              <td>
                {item.currency}
              </td>
              <td className="url">
                https://www.binance.com/en/nft/goods/blindBox/detail?productId={item.productId}&isProduct=1
              </td>
            </tr>
          ))}
        </table>*/
      );
    }
  }
}

export { App };

